window.bookSummaryJSON = "<p>Bertie Wooster's friend Gussie Fink-Nottle is sentenced to 14 days for wading in the fountain at Trafalgar Square. Bertie is worried that Gussie's fiancé Madeline will be angry because she has a distressing habit of turning her attentions to Bertie when her fiancé upsets her. Bertie has the bright idea of impersonating Gussie, and showing up at Deverill Hall. The situation is wonderfully comical when Gussie shows up, posing as Bertie. Only Jeeves, arriving in his own disguise, can sort out this mess. </p>"; 
